import React from 'react';
import './home.css'
import banner_image from './image.png';
import { Link } from "react-router-dom";

class Home extends React.Component {
	render(){
		return(
			<>
			<div className="Nav_class">
				<ul>
				  <li><Link className="navbar-brand" to='/home'>todo</Link></li>
				  <li><Link className="nav-link" to='/home'>bs3 project</Link></li>
				  <li style="float:right"><Link className="nav-link" to='/home'>About</Link></li>
				  <li style="float:right"><Link className="nav-link" to='/home'>Features</Link></li>
				  <li style="float:right"><Link className="nav-link" to='/home'>Price</Link></li>
				  <li style="float:right"><Link className="nav-link" to='/home'>Contact Us</Link></li>
				</ul>
			</div>
			<div className="center">
				<h4>Modern, Clean & Flat</h4>
				<h1>Web <strong className="strong">Appilcation </strong>User Interface</h1>
			</div>
			<div className="banner">
				<img src={banner_image} alt = "banner_image"/>
			</div>
			</>
		)
	}
}

export default Home;
